import axios from 'axios';

const api = axios.create({
  baseURL: 'http://127.0.0.1:8000',   // <-- /api 제거
});

export const fetchInfluence = () => api.get('/total_pagerank');
export const fetchCommunities = () => api.get('/list');
export const fetchCommunityKeywords = (communityId) => api.get(`/keywords/${communityId}`);
export const fetchCommunityPagerank = () => api.get('/pagerank');
export const fetchTrajectory = (author) => api.get(`/trajectory/${author}`);
export const fetchNetworkSummary = () => api.get('/network/summary');
